   },
   "source": [
    "### What about Bellabeat?  \n",
    "  \n",
    "* Bellabeat was founded by Urška Sršen and Sando Mur.\n",
    "* It is a high-tech company that manufactures health-focused smart products.\n",
    "* Successfully positioned itself as a tech-driven wellness company for women.  \n",
    "With these 3 points I believe we have an idea of what Bellabeat is about. "
   ]
  },
  {
   "cell_type": "markdown",
   "id": "4761cbb5",
   "metadata": {
    "papermill": {
     "duration": 0.110291,
     "end_time": "2022-02-26T20:34:30.347219",
     "exception": false,
     "start_time": "2022-02-26T20:34:30.236928",
     "status": "completed"
    },
    "tags": []
   },
   "source": [
    "I am going to use the 6 steps taught in the Google Data Analytics course to guide my analysis.\n",
    "The steps are as follows:  \n",
    "* Ask\n",
    "* Prepare\n",
    "* Process\n",
    "* Analyse\n",
    "* Share \n",
    "* Act"
   ]
  },
