   },
   "source": [
    "# Prepare & Process"
   ]
  },
  {
   "cell_type": "markdown",
   "id": "c7ccdc67",
   "metadata": {
    "papermill": {
     "duration": 0.111096,
     "end_time": "2022-02-26T20:34:31.229717",
     "exception": false,
     "start_time": "2022-02-26T20:34:31.118621",
     "status": "completed"
    },
    "tags": []
   },
   "source": [
    "I will be using the Fitbit Fitness Tracker Data which was gotten from Kaggle and it was made available by Mobius. It contains data from the personal tracker of 30 users who gave the consent for their data to be collected.\n",
    "You can access the data [here](https://www.kaggle.com/arashnic/fitbit)."
   ]
  },
  {
   "cell_type": "markdown",
   "id": "8c913532",
   "metadata": {
